import React from 'react';
import { AppBar, Toolbar, Typography, Button, Box, Container } from '@mui/material';
import { Link as RouterLink } from 'react-router-dom';
import Logo from './Logo';

const Navbar = () => (
  <AppBar position="sticky" color="inherit" elevation={2} sx={{ borderBottom: '2px solid #e3f2fd', bgcolor: '#fff' }}>
    <Container maxWidth="lg">
      <Toolbar disableGutters>
        <Logo />
        <Typography variant="h6" sx={{ flexGrow: 1, fontWeight: 'bold', fontFamily: 'serif', color: '#1976d2' }}>
          GoGetWell AI
        </Typography>
        <Box>
          <Button component={RouterLink} to="/" color="inherit" sx={{ fontWeight: 'bold', fontFamily: 'serif' }}>Home</Button>
          <Button component={RouterLink} to="/features" color="inherit" sx={{ fontWeight: 'bold', fontFamily: 'serif' }}>Features</Button>
          <Button component={RouterLink} to="/pricing" color="inherit" sx={{ fontWeight: 'bold', fontFamily: 'serif' }}>Pricing</Button>
          <Button component={RouterLink} to="/about" color="inherit" sx={{ fontWeight: 'bold', fontFamily: 'serif' }}>About</Button>
          <Button component={RouterLink} to="/contact" color="inherit" sx={{ fontWeight: 'bold', fontFamily: 'serif' }}>Contact</Button>
        </Box>
      </Toolbar>
    </Container>
  </AppBar>
);

export default Navbar;
